まさかであるが，負領域ではわずかに BPS の場合が値が大きい！しかし平均的に見た場合，特に $x\ge0$ の領域では FECMC の圧勝である．

::: {#d844112f .cell execution_count=9}
``` {.julia .cell-code}
ρ = 1.5
x, r_BPS = calc_BPS_resolvent(ρ, T_min=-3.0, T_max=3.0)
pᵣ = plot(x, r_BPS, xlabel=L"t", ylabel=L"\int^\infty_0e^{-ho t}\operatorname{E}_x[X_t]\,dt", label="BPS", title="Resolvent (ρ=$ρ)", linewidth=3, left_margin=4Plots.mm, top_margin=1Plots.mm)
x, r_FECMC = calc_FECMC_resolvent(ρ, T_min=-3.0, T_max=3.0)
plot!(pᵣ, x, r_FECMC, xlabel=L"t", ylabel=L"\int^\infty_0e^{-ho t}\operatorname{E}_x[X_t]\,dt", label="FECMC", title="Resolvent (ρ=$ρ)", linewidth=3)
